const Patientdetails = () => {
  const data = {
    patientName: "김영찬",
    gender: "남",
    age: 25,
    reservationDate: "2023-09-30T11:00:00",
    symptoms: "의료기기 교체",
    height: 170,
    weight: 70,
    Accumulatednumber: 3,
    distance: "13km",
    callnumber: "010-1234-5667",
    birthday: "2000-01-01",
  };
  return (
    <div className="Patientdetails">
      <header className="patientdetailsheader">
        <span>{data.patientName}</span>
        <span>
          {data.gender}
          {data.age}({data.birthday})
        </span>
        <span>
          키:{data.height} 체중:{data.weight}
        </span>
      </header>
      <body className="patientdetailsbody">
        <div>
          <section>과거진료기록</section>
          <section>방문진료 사유</section>
          <section>이동거리편도</section>
        </div>
        <div>필수 작성 / 거동불편 유형 / 자동 메모</div>
      </body>
    </div>
  );
};
export default Patientdetails;
